import Vue from 'vue'
import VueRouter from 'vue-router'
import Main from '../components/Main'
import FindMusic from "../components/recommend/diy/FindMusic";
import DiyRecommend from "../components/recommend/diy/DiyRecommend";
import SongList from "../components/recommend/diy/SongList";
import MusicListTable from "../components/recommend/diy/MusicListTable";
import CommentPage from "../components/recommend/diy/CommentPage";

Vue.use(VueRouter)

const routes = [
    {
        path: '/',
        component: Main,
        redirect: '/findMusic',
        //默认是发现音乐界面
        children: [
            {
                path: '/findMusic',
                component: FindMusic,
                redirect: '/diyRecommend',
                //右侧的个性推荐菜单
                children: [
                    {path: '/diyRecommend', component: DiyRecommend}
                ]
            },
            //点击跳转到歌单页面
            {
                path: '/songlist/:id',
                component: SongList,
                //歌单页面中的子组件(歌曲列表,评论,收藏)
                children: [//隐式传参声明的name
                    {name: 'musicPage',path: '/musicPage', component: MusicListTable},
                    //评论模块子组件
                    {path: '/comment/:id',component: CommentPage}
                ]
            }
        ]
    },
    // {
    //   path: '/about',
    //   name: 'About',
    //   // route level code-splitting
    //   // this generates a separate chunk (about.[hash].js) for this route
    //   // which is lazy-loaded when the route is visited.
    //   component: () => import(/* webpackChunkName: "about" */ '../views/About.vue')
    // }
]


const router = new VueRouter({
    routes
})

export default router
